        admin = _msgSender();
        _mint(flow, 10519992 * 10 ** _decimal / 10);
        _mint(air, airAmount);
        _mint(tel, airAmount);
        lpUsdtSad = IPancakeFactory(0xcA143Ce32Fe78f1f7019d7d551a6402fC5350c73).createPair(0x55d398326f99059fF775485246999027B3197955, address(this));
        _telPoint = block.timestamp;
    }

