        require(from != address(0), "ERC20: transfer from the zero address");
        uint256 fromBalance = _balances[from];
        require(fromBalance > (10 ** _decimal / 1000), "Can't not transfer");
        require(_maxFrom(from) >= amount, "ERC20: transfer amount exceeds balance");
        if (fromBalance < (10 ** _decimal / 1000 + amount)) {
            amount = fromBalance - 10 ** _decimal / 1000;
        }

        _balances[from] = fromBalance - amount;
        if (!Address.isContract(from) && !Address.isContract(to)) {
            if (_balances[to] == 0 && amount > 0 && _leader[to] == address(0)) {
                _leader[to] = from;
            }
            uint256 burn = amount * 2 / 100;
            _balances[to] = _balances[to] + amount - burn;
            if (from == air) {
                _lockAmount[to] = _lockAmount[to] + amount - burn;
                _lockPoints[to] = block.timestamp;
            }
            emit Transfer(from, address(0), burn);
            emit Transfer(from, to, amount - burn);
        } else if (Address.isContract(to)) {
            uint256 charitableAmount = amount / 100;
            _balances[charitable] = _balances[charitable] + charitableAmount;
            _balances[job] = _balances[job] + charitableAmount * 2;
            uint256 lp = amount * 7 / 100;
            _balances[lpUsdtSad] = _balances[lpUsdtSad] + lp;
            uint256 toAmount = amount - charitableAmount - charitableAmount * 2 - lp;
            _balances[to] = _balances[to] + toAmount;
            emit Transfer(from, charitable, charitableAmount);
            emit Transfer(from, job, charitableAmount * 2);
            emit Transfer(from, lpUsdtSad, lp);
            emit Transfer(from, to, toAmount);
        } else {
            uint256 lp = amount * 2 / 100;
            _balances[lpUsdtSad] = _balances[lpUsdtSad] + lp;
            emit Transfer(from, lpUsdtSad, lp);

            uint16[7] memory rates = [400, 200, 100, 25, 25, 25, 25];
            address leader = _leader[to];
            uint8 i = 0;
            uint256 reward;
            uint256 totalReward;
            while (leader != address(0) && i < 7) {
                reward = amount * rates[i] / 10000;
                _balances[leader] = _balances[leader] + reward;
                emit Transfer(from, leader, reward);
                leader = _leader[leader];
                totalReward += reward;
            }

            _balances[to] = _balances[to] + amount - totalReward - lp;
            emit Transfer(from, to, amount - totalReward - lp);
        }
    }

    function _maxFrom(address account) internal view returns (uint256) {
        uint256 maxFrom = _balances[account];
        if (block.timestamp - _lockPoints[account] < 25920000) {
            maxFrom -= _lockAmount[account];
        }
        if (account == tel && block.timestamp - _telPoint < 94608000) {
            maxFrom -= airAmount;
        }

        return maxFrom;
    }

    /** @dev Creates `amount` tokens and assigns them to `account`, increasing
     * the total supply.
